import Link from 'next/link';
import {url, ts, publicKey, hash} from '../config/config';
import axios from 'axios';

const linkStyle = {
  marginRight: '20px',
};

const Stories = () => (
  <section>
    <Link href='/characters'>
      <a style={linkStyle}>Characters</a>
    </Link>
    <Link href='/comics'>
      <a style={linkStyle}>Comics</a>
    </Link>
    <Link href='/'>
      <a style={linkStyle}>Home</a>
    </Link>
    <h1>Stories</h1>
    <p>Hola mundo desde Stories</p>
  </section>
);

export async function getStaticProps() {
  const link = `${url}/v1/public/stories?ts=${ts}&apikey=${publicKey}&hash=${hash}`;
  const req = await axios.get(link);
  return {
    props: {
      stories: req.data.data.results
    }
  }
}

export default Stories;
